public void closeOk()
{
    TmpEximConfirmOrderTable_IN confirmOrderTable;
    TmpEximConfirmOrderLines_IN confirmOrderLines;
    ;

    confirmOrderTable.setTmpData(eximConfirmOrderTable);
    confirmOrderLines.setTmpData(eximConfirmOrderLines);

    caller.parmTmpConfirmOrderTable(confirmOrderTable);
    caller.parmTmpConfirmOrderLines(confirmOrderLines);

    super();
}

public void init()
{
    Object callerObject;
    ;

    super();

    callerObject = element.args().caller();

    if (!element.args()
        || !callerObject
        || !(callerObject is EximAuthorization_Confirmed_IN))
    {
        throw error("@SYS22539");
    }

    caller = callerObject;

    caller.insertTmpConfirmedOrder();
    eximConfirmOrderTable.setTmpData(caller.parmTmpConfirmOrderTable());
    eximConfirmOrderLines.setTmpData(caller.parmTmpConfirmOrderLines());
    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public void showData()
{
    if (!fromdate.dateValue() || !toDate.dateValue())
    {
        checkFailed("@SYS39609");
    }
    else if (fromdate.dateValue() > toDate.dateValue())
    {
        checkFailed("@SYS103965");
    }
    else
    {
        caller.showData(fromDate.dateValue(), toDate.dateValue());
        eximConfirmOrderTable.setTmpData(caller.parmTmpConfirmOrderTable());
        eximConfirmOrderLines.setTmpData(caller.parmTmpConfirmOrderLines());
        eximConfirmOrderTable_ds.executeQuery();
        eximConfirmOrderLines_ds.executeQuery();
    }
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    SalesLine      salesLine;
    InventMovement movement = InventMovement::construct(salesLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;
    }
}

